tables.table_schema:
CREATE TABLE TenantOccupationRates (
    property_id INT PRIMARY KEY,
    tenant_id INT,
    occupation_rate DECIMAL(5,2),
    rental_property_address VARCHAR(255)
);

CREATE TABLE properties (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(255) NOT NULL,
    address VARCHAR(255) NOT NULL,
    rental_rate DECIMAL(12,2) NOT NULL
);

CREATE TABLE occupation_rates (
    id INT PRIMARY KEY,
    property_id INT NOT NULL,
    tenant_id INT NOT NULL,
    occupation_rate DECIMAL(5,2) NOT NULL,
    occupation_date DATE NOT NULL
);

CREATE TABLE TenantOccupationRates (
    property_id INT NOT NULL,
    tenant_id INT NOT NULL,
    occupation_rate DECIMAL(4,2) NOT NULL,
    PRIMARY KEY (property_id, tenant_id)
);

CREATE TABLE RentalProperties (
    property_id INT PRIMARY KEY,
    property_name VARCHAR(255) NOT NULL,
    location VARCHAR(255) NOT NULL,
    total_units INT NOT NULL
);

CREATE TABLE Tenants (
    tenant_id INT PRIMARY KEY,
    tenant_name VARCHAR(255) NOT NULL,
    contact_number VARCHAR(15) NOT NULL,
    email VARCHAR(255) NOT NULL
);

CREATE TABLE RentalDemand (
    property_id INT NOT NULL,
    demand_level ENUM('High', 'Medium', 'Low') NOT NULL,
    demand_date DATE NOT NULL,
    PRIMARY KEY (property_id, demand_date)
);
